[{"location":"api/#DigiPopData.parse_metric_bindings-Tuple{DataFrames.DataFrame}","page":"API","title":"DigiPopData.parse_metric_bindings","text":"parse_metric_bindings(df::DataFrame)\n\nParses a DataFrame containing metric bindings and returns an array of MetricBinding objects. The DataFrame should contain the following columns:\n\nid: Unique identifier for the metric binding.\nscenario: The scenario to which the metric binding applies.\nendpoint: The observable (endpoint) associated with the metric binding.\nmetric.type: The type of metric (e.g., \"mean\", \"category\", etc.).\nactive: (optional) A boolean indicating whether the metric binding is active (default is true).\n\nThe function uses the PARSERS dictionary to find the appropriate parser for the metric type. The function iterates over each row of the DataFrame, extracting the relevant information and creating a MetricBinding object.\n\nReturns\n\nAn array of MetricBinding objects.\n\n\n\n\n\n","category":"method"},{"location":"#DigiPopData.jl","page":"Home","title":"DigiPopData.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Data prep and visualization tools for Virtual Patient QSP modeling","category":"page"}]
